package vn.group.model;

public class MyColorModel {
	private int color1;
	private int color2;
	private int color3;
	public MyColorModel() {
		super();
		// TODO Auto-generated constructor stub
	}
	public MyColorModel(int color1, int color2, int color3) {
		super();
		this.color1 = color1;
		this.color2 = color2;
		this.color3 = color3;
	}
	public int getColor1() {
		return color1;
	}
	public void setColor1(int color1) {
		this.color1 = color1;
	}
	public int getColor2() {
		return color2;
	}
	public void setColor2(int color2) {
		this.color2 = color2;
	}
	public int getColor3() {
		return color3;
	}
	public void setColor3(int color3) {
		this.color3 = color3;
	}
	
}

